INSERT INTO `itens` VALUES (1,'','R$ 2.899,99','\nAsus MD15 um dos menores notebooks de 15 polegadas do mundo\nSeja para trabalho ou lazer, o ASUS M515  um notebook que oferece desempenho poderoso e visuais envolventes. Sua tela NanoEdge possui um revestimento antirreflexo fosco para uma experincia verdadeiramente envolvente. O M515  equipado com at processador AMD Ryzen e memria de 8 GB. Armazenamento rpido com SSD com at 256GB PCIe SSD.\n\nMais velocidade no seu dia a dia\nO ASUS M515 possui armazenamento SSD, que alm de ser muito mais rpido que o HD convencional,  menor, mais leve e no tem partes mecnicas extremamente sensveis a impactos e solavancos. Isso garante maior proteo aos dados armazenados no seu notebook, para que voc possa trabalhar sem preocupaes, com alto desempenho e produtividade, mesmo em um veculo em movimento.\n\nRpido e eficiente\nCom processadores at SrioAMD Ryzen com 8 GB de memria, o ASUS M515 ajuda voc a fazer as coisas com rapidez e eficincia.\n\nTenha uma viso mais ampla do mundo\nA tela NanoEdge d ao ASUS M515 uma vasta rea de tela para uma experincia de visualizao envolvente seja para o trabalho ou lazer. Com tela FHD de viso ampla apresenta um revestimento antirreflexo para reduzir distraes indesejadas de reflexos irritantes, para que voc possa realmente se concentrar no que est  sua frente.\n','Notebook Asus AMD Ryzen 5-3500U, 8GB RAM, SSD 256GB, 15,6\', Radeon Vega 8, Windows 11 Home, Cinza - M515DA-BR1213W',2),(2,'','R$ 1.999,00','\n\nSmartphone Samsung Galaxy S20 FE 5G 128GB\n \nEste  o smartphone para pessoas que querem tudo. Ouvimos vocs, os fs, e agora no precisam mais ficar em dvida sobre o que escolher. Este  o smartphone feito sob medida para fs de todos os tipos. Ento, se voc  f de fotografia, jogos ou adora deixar seu feed repleto de tudo que o inspira, ns reunimos a combinao definitiva de inovao S20. Este  o smartphone que oferece o que voc deseja, para voc fazer mais daquilo que ama.\n\nA Cmera de Lente Tripla de Nvel Profissional\nA cmera de lente tripla de nvel profissional permite que voc tire aquela foto profissional digna de #semfiltro com facilidade. Enquadre a cena com a cmera wide e, a seguir, mostre ainda mais com a cmera ultra-wide, ou aumente o zoom com o zoom ptico de 3x na cmera teleobjetiva.\n\nConectividade\nO LTE de at 1,6 Gbps oferece velocidades de dados poderosas, enquanto o Wi-Fi 6 conecta voc com segurana e baixa latncia, mesmo em um local lotado. Portanto, quer voc esteja conectado a LTE ou Wi-Fi, pode jogar em tempo real com pouco atraso.\n\nBateria Inteligente o Dia Todo para que Voc possa Jogar por Horas\nViva sua vida sem se preocupar com onde voc pode conectar seu smartphone. A bateria de 4500mAh (padro) d ao seu smartphone a energia necessria para durar mais que o seu dia, e  inteligente o suficiente para economizar energia para quando voc realmente precisar.\n \nEspao para Milhares de Fotos e Vdeos\nCom 128 GB integrados e a capacidade de armazenar at 1 TB (no incluso) a mais em um carto microSD, o nico limite para o que voc pode armazenar  o que voc pode criar e baixar.\n\n','Smartphone Samsung Galaxy S20 FE 5G, 6GB RAM, Snapdragon 865, 128GB, Octa Core, Cmera Tripla 32MP, Tela Infinita 6.5, Azul Marinho - SM-G781BZBRZTO',3),(3,'','R$ 1.299,99','A TGC12 ThunderX3  uma cadeira gamer com revestimento de Poliuretano (PU) coberta com costuras de fibra de carbono. Seu estofado  em forma de diamantes construda com firmeza para proporcionar conforto enquanto voc desfruta do prazer de jogar seus games favoritos. Da sala de estar para a sala de jogos, voc pode planejar a prxima dominao do mundo do conforto de sua cadeira gamer.','Cadeira Gamer ThunderX3 TGC12, Black',5),(4,'','R$ 4.499,90','\nConsole Sony Playstation 5\n \nJogar no PS5 No Tem Limites\nDesfrute do carregamento do seu PS5, extremamente rpido com o SSD de altssima velocidade, uma imerso mais profunda com suporte a feedback ttil, gatilhos adaptveis e udio 3D, alm de uma gerao indita de jogos incrveis para PlayStation.\n\nVeloz como um raio, SSD ultrarrpido\nDomine o poder de uma CPU e GPU personalizadas e o SSD com E/S integradas que redefinem as regras do que o console PlayStation pode fazer.\n\nMaximize suas sesses de jogo com tempo de carregamento praticamente instantneo para jogos do PS5 instalados.\n\nJogos impressionantes para PS5\nMaravilhe-se com os grficos incrveis e experimente os recursos do novo PS5. \'Ray Tracing\' (Rastreamento de raios) Mergulhe em mundos com um nvel indito de realismo enquanto os raios de luz so simulados individualmente, criando sombras e reflexos realistas em jogos compatveis com Playstation 5. Jogos para TVs 4K Curta seus jogos favoritos do PS5 na sua incrvel TV 4K. At 120 fps com sada em 120 Hz Desfrute da fluidez e taxa de quadros de at 120 fps em jogos compatveis, com suporte a sada de 120 Hz em telas 4K.\n\nTecnologia HDR\nCom uma TV HDR, os jogos compatveis do PS5 exibem uma variedade de cores inacreditavelmente vibrantes e realistas. Sada em 8K Os consoles PS5 oferecem suporte  sada 8K, para que voc possa jogar na sua tela com resoluo de 4320p.\n\nTempest 3D AudioTech\nMergulhe em palcos sonoros que faro voc acreditar que os sons esto vindo de todas as direes. Seja com seus fones de ouvido ou os alto-falantes de sua TV, seu ambiente ganhar vida com o Tempest 3D AudioTech em jogos compatveis.\n\nResposta ttil\nExperimente a resposta ttil com o controle sem fio DualSense em jogos selecionados do PS5 e sinta o impacto de suas aes no jogo atravs da resposta sensorial dinmica.\n\nGatilhos adaptveis\nAssuma o controle com os imersivos gatilhos adaptveis, agora com nveis dinmicos de resistncia que simulam o impacto fsico das atividades em jogos selecionados do PS5.\n\n','Console Sony Playstation 5',4),(5,'','R$ 179,99','\nHeadset Gamer HyperX Cloud Stinger\n \nFaa parte da famlia Cloud da HyperX com o headset Cloud Stinger!\nCompleta e verstil, a linha de headsets Cloud foi projetada para as necessidades de qualquer nvel de jogador. Independente do seu sistema, estilo de jogo e caractersticas este headset ir te surpreender. O Cloud Stinger  um modelo licenciado oficialmente pela Xbox, perfeito para jogadores de Xbox One! Conforto, tecnologia e design a sua altura.\n\nHyperX confortvel para todo tipo de rosto\nOs fones de ouvido giram 90 e ficam bem apoiados confortavelmente em torno do pescoo durante os intervalos de batalhas. Como todo headset HyperX, possui a tecnologia premiada da espuma memory foam. Alm do conforto, a qualidade do som  impecvel! Este modelo possui drivers de 50mm que oferecem qualidade de som impecveis com preciso de udio e garantindo sua imerso no jogo. Ainda para seu conforto possui controles em ao de alta qualidade so projetados para longa durabilidade e estabilidade, se ajustando perfeitamente.\n\nSom imersivo para voc se sentir no jogo com o Headset HyperX\nPossui tambm controle deslizante de volume para sua comodidade. Ele est localizado na parte inferior do fone de ouvido direito. Seu microfone tem cancelamento de rudo que gira para ser silenciado. Tambm com rudo passivo integrado que reduz o rudo de fundo para uma melhor qualidade de voz em seus jogos multiplayer. Um dos seus diferenciais tambm  sua leveza, um headset leve e com toda a tecnologia que voc precisa.\n','Headset Gamer HyperX Cloud Stinger, Drivers 50mm, Mltiplas Plataformas, P2 e P3 - HX-HSCS-BK/NA',7),(6,'','R$ 1.089,99','\nProcessador Intel Core i5-10400 \nOs novos processadores Intel Core da 10 Gerao oferecem atualizaes de desempenho incrveis para melhorar a produtividade e proporcionar entretenimento surpreendente, Intel Wi-Fi 6 (Gig) tecnologia, HDR 4K, otimizao de sistema inteligentes e muito mais. \n\nProdutividade acelerada \nRecursos de desempenho inteligente integrados aprendem e se adaptam ao que voc faz, direcionando potncia dinamicamente para onde ela  mais necessria. Os processadores Intel Core da 10 Gerao com memria Intel Optane fornecem a responsividade para fazer mais.\n\nA melhor conectividade da categoria \nCom Intel Wi-Fi 6 (Gig+) e tecnologia Thunderbolt 3 integrados, os processadores Intel Core da 10 Gerao oferecem conectividade cabeada e sem fio rpida, garantida e verstil.\n\nEntretenimento premium \nUma nova arquitetura de grficos oferece suporte a experincias visuais ultravvidas, como vdeo em HDR 4K e jogos a 1080p. Os processadores Intel Core da 10  Gerao com grficos Intel Iris Plus permitem experincias de entretenimento nunca vistas.\n\nJogos srios (serious gaming) \nAproveite jogos incrveis com alto FPS, at mesmo enquanto realiza streaming e gravao. Turbo e acelerao da memria Intel Optane. Em casa ou em qualquer lugar, processadores Intel Core da 10 Gerao capazes de overclocking rodam as plataformas definitivas de jogos em notebooks e desktops.\n\nPossui Vdeo Integrado \n','Processador Intel Core i5-10400, 2.9GHz (4.3GHz Max Turbo), Cache 12MB, LGA 1200 - BX8070110400',6),(7,'','R$ 1.089,99','\nProcessador Intel Core i5-10400 \nOs novos processadores Intel Core da 10 Gerao oferecem atualizaes de desempenho incrveis para melhorar a produtividade e proporcionar entretenimento surpreendente, Intel Wi-Fi 6 (Gig) tecnologia, HDR 4K, otimizao de sistema inteligentes e muito mais. \n\nProdutividade acelerada \nRecursos de desempenho inteligente integrados aprendem e se adaptam ao que voc faz, direcionando potncia dinamicamente para onde ela  mais necessria. Os processadores Intel Core da 10 Gerao com memria Intel Optane fornecem a responsividade para fazer mais.\n\nA melhor conectividade da categoria \nCom Intel Wi-Fi 6 (Gig+) e tecnologia Thunderbolt 3 integrados, os processadores Intel Core da 10 Gerao oferecem conectividade cabeada e sem fio rpida, garantida e verstil.\n\nEntretenimento premium \nUma nova arquitetura de grficos oferece suporte a experincias visuais ultravvidas, como vdeo em HDR 4K e jogos a 1080p. Os processadores Intel Core da 10  Gerao com grficos Intel Iris Plus permitem experincias de entretenimento nunca vistas.\n\nJogos srios (serious gaming) \nAproveite jogos incrveis com alto FPS, at mesmo enquanto realiza streaming e gravao. Turbo e acelerao da memria Intel Optane. Em casa ou em qualquer lugar, processadores Intel Core da 10 Gerao capazes de overclocking rodam as plataformas definitivas de jogos em notebooks e desktops.\n\nPossui Vdeo Integrado \n','Processador Intel Core i5-10400, 2.9GHz (4.3GHz Max Turbo), Cache 12MB, LGA 1200 - BX8070110400',6),(8,'','R$ 1.089,99','\nProcessador Intel Core i5-10400 \nOs novos processadores Intel Core da 10 Gerao oferecem atualizaes de desempenho incrveis para melhorar a produtividade e proporcionar entretenimento surpreendente, Intel Wi-Fi 6 (Gig) tecnologia, HDR 4K, otimizao de sistema inteligentes e muito mais. \n\nProdutividade acelerada \nRecursos de desempenho inteligente integrados aprendem e se adaptam ao que voc faz, direcionando potncia dinamicamente para onde ela  mais necessria. Os processadores Intel Core da 10 Gerao com memria Intel Optane fornecem a responsividade para fazer mais.\n\nA melhor conectividade da categoria \nCom Intel Wi-Fi 6 (Gig+) e tecnologia Thunderbolt 3 integrados, os processadores Intel Core da 10 Gerao oferecem conectividade cabeada e sem fio rpida, garantida e verstil.\n\nEntretenimento premium \nUma nova arquitetura de grficos oferece suporte a experincias visuais ultravvidas, como vdeo em HDR 4K e jogos a 1080p. Os processadores Intel Core da 10  Gerao com grficos Intel Iris Plus permitem experincias de entretenimento nunca vistas.\n\nJogos srios (serious gaming) \nAproveite jogos incrveis com alto FPS, at mesmo enquanto realiza streaming e gravao. Turbo e acelerao da memria Intel Optane. Em casa ou em qualquer lugar, processadores Intel Core da 10 Gerao capazes de overclocking rodam as plataformas definitivas de jogos em notebooks e desktops.\n\nPossui Vdeo Integrado \n','Processador Intel Core i5-10400, 2.9GHz (4.3GHz Max Turbo), Cache 12MB, LGA 1200 - BX8070110400',6),(9,'\\n','R$ 4.499,99','\nPC Gamer Concrdia 32732\n \nEscolhemos um Gabinete Gamer com design bonito e arrojado com frontal com iluminao RGB que certamente trar mais evidncia para o seu setup. O PC Gamer Concrdia vem equipado com um poderoso processador Intel Core i5 de 10 Gerao que oferece atualizaes de desempenho incrveis para melhorar a produtividade, proporcionando entretenimento surpreendente.\n\nCuidadosamente pensado para jogadores de alto nvel, o PC Gamer Concrdia possui uma GTX 1650 de 4GB, que fornece um desempenho  para qualquer tarefa ou jogos mais recentes.\n\nQuando o assunto  velocidade, seu SSD de 480GB certamente dar conta do recado, armazene e acesse  todos os seus arquivos e programas em um piscar de olhos. \n','PC Gamer Concrdia Processador Core i5-10400F, RGB, Geforce GTX1650, 8GB, SSD 480GB, Preto - 32726',1);
